#![allow(clippy::needless_option_as_deref)]
use pyo3::{exceptions, prelude::*}; #[pyfunction]
pub fn example_sql() -> PyResult<String> { Ok(queryer::example_sql())
} #[pyfunction]
pub fn query(sql: &str, output: Option<&str>) -> PyResult<String> { let rt = tokio::runtime::Runtime::new().unwrap(); let data = rt.block_on(async { queryer::query(sql).await.unwrap() }); match output { Some("csv") | None => Ok(data.to_csv().unwrap()), Some(v) => Err(exceptions::PyTypeError::new_err(format!( "Output type {} not supported", v ))), }
} #[pymodule]
fn queryer_py(_py: Python, m: &PyModule) -> PyResult<()> { m.add_function(wrap_pyfunction!(query, m)?)?; m.add_function(wrap_pyfunction!(example_sql, m)?)?; Ok(())
}

